INSERT INTO `products` VALUES (1,1,'ND39_446590','5903246491340','Starpak','Rucsac, Starpak, Textil, 39.5 x 29 x 20 cm, Albastru','<p>Nota: Aceasta descriere a fost tradusa automat in limba romana.</p>\n\n<p>&nbsp;</p>\n\n<h1><strong>ND39_446590 I RUACAC STK-14 GOOD VIBES PB 1/12</strong></h1>\n\n<p>&nbsp;</p>\n\n<p><br>\nUn rucsac de scoala format din doua compartimente cu fermoar, care va permite o mai buna organizare a spatiului interior. La exterior, este un frontal foarte spatios, buzunar cu fermoar, doua buzunare laterale cu varpa, perfecte pentru a pune o sticla de apa in ele. Bretelele pentru spate si umar captusite cu burete asigura confortul de utilizare si distributia uniforma a sarcinii pe spatele copilului. Fabricat din material rezistent finisat cu elemente reflectorizante pentru o mai mare siguranta. Dimensiuni: 39,5 x 29 x 20 cm<br>\n&nbsp;<br><br><br><br>\nINFORMATII: In cazul in care fotografiile prezinta produse in mai multe culori sau forme, sau este reprezentat intregul display sau ambalajul colectiv cu produse. Trebuie inteles ca pretul se aplica pentru o singura bucata dintr-un produs dat, nu pentru multiplu.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n',90.49,19.00,107.68,10,'Active','2024-08-11 07:40:58','2024-08-11 07:58:48'),(2,1,'4897091811556','4897091811556','Fisher Price','Set de jucarii pentru baie animalute si girafa plasa, Fisher Price','<ul><li><p>Micutului tau ii place sa se joace cu jucariile in apa? Astfel de activitati nu numai ca dezvolta imaginatia remarcabil, dar ii permit copilului sa isi coordoneze mai bine miscarile, sa atinga cu degetul obiecte de diferite dimensiuni cu degetele si, de asemenea, sa invete sa distinga culorile si formele. Setul de plasa cu girafe si animale de joaca te invata cum sa-ti arunci unealta departe in baie pentru a scoate jucariile tale preferate! Animalele se mentin bine pe linia de plutire, asa ca sunt usor de gasit printre spuma parfumata in timp ce inoata. Plasa poate fi atasata de peretele cazii pentru a antrena precizia fiecarei aruncari, intrand in plasa.</p></li></ul>',50.41,19.00,59.99,1,'Active','2024-08-11 07:41:10','2024-08-11 15:48:09'),(3,1,'J1213051','5949999724892','Ats','Papusa manechin salvamar cu colac de salvare si binoclu, pentru fete, ATS','<h1 dir=\"ltr\">Papusa manechin salvamar cu colac de salvare si binoclu<br><img alt=\"\" src=\"https://i.imgur.com/H7NDkOE.jpg\"><br> Dimensiuni pachet 12x5x32 cm</h1>',31.00,19.00,36.89,0,'Active','2024-08-11 07:41:10','2024-08-11 07:41:10'),(4,1,'SB-270','0749672945928','Addams Family','Papusa Wednesday','<p>Papusa Wednesday Addams Family. Inaltime 16 cm. Este realizata din plastic si imbracata in haine din material textil. Este recomandata copiilor peste 3 ani. </p>',95.00,19.00,113.05,0,'Active','2024-08-11 07:41:10','2024-08-11 07:41:10'),(5,1,'989','5949999730923','Actual Investing','Set moara cu apa si unelte pentru nisip, 30cm, 5 piese','<p>Inaltime: 30 cm&nbsp;<br><br>\nMaterial: plastic.&nbsp;<br><br>\n* ATENTIE!&nbsp;Nu este potrivit pentru copiii cu varsta sub 18 luni.</p>',33.60,19.00,39.98,1,'Active','2024-08-11 07:41:10','2024-08-11 07:59:10'),(6,1,'GIM34919053','5204549146372','Javoli','Rucsac Fisher Price, Javoli, Poliester, 30 x 20 x 10 cm, Roz/Albastru','<p>Nota: Aceasta descriere a fost tradusa automat in limba romana.</p>\n\n<p>Rucsac Fisher Price.</p>\n\n<p>Dimensiune: 30 x 20&nbsp;x 10&nbsp;cm</p>\n\n<p>Are doua compartimente de depozitare si doua buzunare laterale mici.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n',88.50,19.00,105.32,0,'Active','2024-08-11 07:41:11','2024-08-11 07:41:11'),(7,1,'J1177088','5949999501950','Ats','Papusa Salvamar Brad cu prosop si casti, ATS + 3 ani','<p><img alt=\"\" src=\"https://i.imgur.com/cCAFaLM.jpg\"></p>\n\n\nPapusa pe plaja cu prosop si casti. \n\nLungime x Latime x Inaltime ambalare: 13x6x33 cm.\n\nVarsta recomandata de 3 ani si peste. * ATENTIE! Nu este potrivit pentru copiii sub 3 ani.\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><img alt=\"\" src=\"https://i.imgur.com/cCAFaLM.jpg\"></p>',29.00,19.00,34.51,0,'Active','2024-08-11 07:41:11','2024-08-11 07:41:11'),(8,1,'0887961902242','887961902242','Fisher Price','Jucarie Fisher Price - Piramida Rock-a-Stack','<p><strong>Jucarie Fisher Price - Piramida Rock-a-Stack</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>Aceasta jucarie Fisher-Price Rock-a-Stack este fabricata din materiale vegetale si ofera distractie clasica de constructie pentru bebelusi. Dispune de o baza stabila si 5 inele colorate perfecte pentru maini mici ale micutului tau. Construirea il ajuta pe bebelusul tau sa-si dezvolte coordonarea mana-ochi si il introduce in conceptul de dimensiune relativa, pe masura ce invata sa sorteze si sa construiasca de la cel mai mare la cel mai mic! Jucaria este fabricata dintr-un minimum de 90% etanol extras din trestie de zahar. &nbsp;</p><p>Jucaria clasica de constructie vine cu 5 inele colorate si o baza stabila, este confectionata din materiale vegetale, sustenabile. Vine in pachet certificat FSC. Ajuta la introducerea conceptului de dimensiune relativa, deoarece bebelusul asaza inelele de la cel mai mare la cel mai mic. Apucarea inelelor ajuta la dezvoltarea abilitatilor motorii fine si a rezolvarii problemelor.</p><p>Dimensiuni ambalaj: 14 x 12.5 x 21.5 cm</p><p>&nbsp;</p><figure><img src=\"https://upload.wikimedia.org/wikipedia/en/8/80/Fisher-Price_logo_2020.png\" alt=\"File:Fisher-Price logo 2020.png - Wikipedia\"></figure><p>&nbsp;</p>',40.33,19.00,47.99,0,'Active','2024-08-11 07:41:12','2024-08-11 07:41:12'),(9,1,'LEG10946','4020972109460','Small Foot','Turn Montessori in echilibru pastel LEG10946','<p>Jucarie educativa pentru copii turn Montessori din lemn este o baza din lemn cu suport vertical pe care se pun elemente colorate din lemn, unul deasupra celuilalt, in ordinea marimii pentru a crea o piramida, sau dupa cum doreste copilul.<br><br>\r\nFiecare cerc gros din lemn are o alta culoare. Baza in forma de jumatate de sfera va stimula concentrarea si coordonarea.<br><br>\r\nDimensiune: h 12&nbsp;cm, &Oslash;: 10 cm<br>\r\nVarsta recomandata peste 12 luni.</p>\r\n',57.98,19.00,69.00,0,'Active','2024-08-11 07:41:12','2024-08-11 07:41:12'),(10,1,'ND39_483104','5908275179702','inny','Trusa de infrumusetare copii, Multicolor','<p>Nota: Aceasta descriere a fost tradusa automat in limba romana.</p> <p> </p> <h1><strong>ND39_483104 SET FRUMOS RUACAC MC 17X19X9 36/72</strong></h1> <p> </p> <p><br> Avantajele produsului: dezvoltarea simtului estetic al copilului, dezvoltarea imaginatiei prin diverse scenarii de joaca. O printesa nu are propriul ei colt de frumusete Relaxati-va MEGA CREATIVE s-a asigurat ca fiecare tanara printesa isi completeaza garderoba cu accesorii si accesorii frumoase.Un set de 22 de accesorii intr-un rucsac de plastic. Continutul setului: uscator de par, umerase, oglinda, organizator cu pensule de machiaj, paleta cu varfuri, oglinda cu deschidere, ac de par, pieptene. Totul este din plastic. Dimensiuni/Greutate/Baterie: Dimensiunile produsului L x H x D cm: 17x19x9, dimensiuni ambalaj LxHxD cm: 17x19x9, greutate produs in pachet kg: 0,29 kg, nu necesita baterii. Setul este destinat copiilor cu varsta de: 3 . Setul este ambalat intr-un rucsac de plastic la indemana. Intr-o cutie colectiva de 36 buc.<br><img src=\"http://b2b.euro-trade.pl/Zdj/img/m/MEGA_CREATIVE_483104.jpg\" alt=\"Unknown Image\"><br>INFORMATII: In cazul in care fotografiile prezinta produse in mai multe culori sau forme, sau este reprezentat intregul display sau ambalajul colectiv cu produse. Trebuie inteles ca pretul se aplica pentru o singura bucata dintr-un produs dat, nu pentru multiplu.</p> <p> </p> <p> </p>',41.44,19.00,49.31,0,'Active','2024-08-11 07:41:12','2024-08-11 07:41:12'),(11,1,'MG1188','4043946308454','Paw Patrol','Set Paw Patrol, 4 piese, ghiozdan gradinita, borseta, sac sport si portofel, albastru','<div><span>Dimensiuni:</span> <ul><li><span>Ghiozdan: 29x20x11 cm</span></li> <li><span>Borseta: 