u lansator stralucesc in intuneric pentru a face jocul mult mai interesant pe timpul noptii.</span></span></span></span></span><br><span><span><span><span><span>Acest vehicul lansator de rachete, reda muzica, lumineaza LED si dispune de deschiderea usilor. Dupa pornire, masinuta devine autonoma efectuand rotiri de 360 de grade in jurul propriului ax, in timp ce usile se deschid si apare si lansatorul de discuri fosforescente.</span></span></span></span></span><br><span><span><span><span><span><span>Masina se poate roti 360 grade, iar atunci cand intalneste un obstacol in calea sa isi schimba directia de mers, ruland in continuare.</span></span></span></span></span></span><br><span><span><span><span><span><span>In timpul functionarii masina de deplaseaza, luminile acesteia se aprind, emite sunete, usile se deschid si se ridica lansatorul de discuri pentru a arunca cate un disc. </span></span></span></span></span></span><br><span><span><span><span><span><span>Ulterior, aceasta masina se inchide, pentru a se redeschide din nou spre distractia celor mici.</span></span></span></span></span></span><br><span><span><span><span><span><span>Cele 6 discuri se incarca in lansator prin deschiderea in lateral a partii superioare - spate a masinii si apoi a capacului de pe lansator.</span></span></span></span></span></span><br><span><span><span><span><span><span>Produsul este realizat din plastic rezistent, non-toxic si functioneaza cu 4 baterii de tipul 1,5 V AA, neincluse in pachet. </span></span></span></span></span></span><br><span><span><span><span><span><span>Bateriile se introduc in pozitia corecta, respectandu-se polaritatea. Compartimentul bateriilor trebuie sa fie curat. Bateriile epuizate se schimba si se recicleaza conform normelor in vigoare. </span></span></span></span></span></span><br><span><span><span><span><span><span>In cazul neutilizarii jucariei pentru mai mult timp, se scot bateriile pana in momentul refolosirii.</span></span></span></span></span></span><br><