9.00,130.90,1,'Active','2024-08-11 07:58:25','2024-08-11 13:43:38'),(139,1,'SB-258','0749672945829','OEM','Jucarie Masinuta sport cu telecomanda, Lumini, inchidere usi si eliberare fum, LED, Rosu','',84.03,19.00,100.00,0,'Active','2024-08-11 07:58:28','2024-08-11 07:58:28'),(140,1,'SB-254','0749672945782','Die Cast','Masina metalica, Sport, Lumini si sunete, Usi si Portbagaj mobile, 11 cm, Gri','',42.01,19.00,49.99,0,'Active','2024-08-11 07:58:29','2024-08-11 07:58:29'),(141,1,'SB-250','0749672945744','OEM','Orga Muzicala Pentru Copii Multiple Functii, 44 Clape, Ambalaj 56x19x8 CM, Negru','',110.07,19.00,130.98,0,'Active','2024-08-11 07:58:33','2024-08-11 07:58:33'),(142,1,'SB-275','0749672946024','Nova','Ondulator ceramic in spirala pentru par, temperatura putere 120-200C, incalzire rapida, negru','<p>Ondulator ceramic de par in spirala</p> <p>Specificatii tehnice:</p> <p>Se incalzeste rapid</p> <p>Material placa: ceramica, plastic</p> <p>Indicator de putere Temperatura: 120-200&deg;C</p> <p>Cordon rotativ</p> <p>Lungimea cablului de alimentare: 165cm</p> <p>Dimensiuni ondulator: 31cm x 4cm</p> <p>Alimentare: 240V</p> <p>Putere: 35W</p> <p>Culoare: negru - visiniu</p> <p>Produsul este certificat CE</p>',58.82,19.00,70.00,0,'Active','2024-08-11 07:58:35','2024-08-11 07:58:35'),(143,1,'SB-255','0749672945799','Die Cast','Masina metalica, Sport, Lumini si sunete, Usi si Portbagaj mobile, 11 cm, Orange','<p><strong>Varsta</strong>: 3+ (nu este potrivit pentru copiii sub 3 ani)</p> <div> </div> <div><strong>Material</strong>: Corp metalic cu piese din plastic</div> <div> </div> <div><strong>Caracteristici</strong>: Lumina si sunet (butonul se afla sub roata fata-dreapta si se actioneaza prin apasarea rotii), usi care se pot deschide, actionare pull-back</div> <div><br><strong>Ideal pentru</strong>: iubitori de masini, pasionati de masini, miniaturi<br> colectionari de modele, jucarie perfecta pentru copiii care<br> iubesc sa se joace cu masini in miniatura, obiecte de colectie</div> <div><br><strong>Dimensiuni produs</strong> (aproximativ): Jucaria metalica<br> masina masoara 11 cm lungime, 5 cm latime</div>',47.05,19.00,55.99,2,'Active','2024-08-11 07:58:36','2024-08-11 17:38:20'),(144,1,'SB-259','0749672945836','OEM','Masina cu telecomanda pentru copii 2.4 GHz, Controlabila cu ceas de mana, Rotire 360 grade, Lumini interactive, Reincarcabila, Pentru cascadorii, Albastru','<p>Masinuta cu telecomanda pentru copii ce se poate controla prin ceas si telecomanda. Acesta este instrumentul perfect pentru a-si dezvolta abilitatile de coordonare si pentru a se distra la maxim.</p> <p>ATENTIE! Daca doriti sa folositi telecomanda masinii dupa ce s-a folosit cu ceasul, masinuta trebuie oprita si pornita din nou pentru a se face schimbarea!</p> <p> </p> <p>Cu functia de intoarcere acrobatica, masinuta noastra poate realiza cascadorii spectaculoase si miscari surprinzatoare. O experienta plina de adrenalina pentru micii soferi.</p> <p>Aceasta masina RC deformabila se poate misca in toate directiile, face intoarceri de 360 de grade, tractiune pe 4 roti, cu o distanta de control de 40 de metri, va permite sa o jucati in aer liber fara griji.</p> <p>Masinuta functioneaza pe baza unui acumulator reincarcabil, acesta vine insotit de cablul de incarcare, iar telecomanda functioneaza pe baza a 2 baterii AA(nu sunt incluse in pachet). Totodata ceasul vine insotit cu 2 baterii 1.5V AAA.</p> <p> </p>',158.81,19.00,188.98,0,'Active','2024-08-11 07:58:40','2024-08-11 07:58:40'),(145,1,'SB-265','0749672945935','OEM','Masina de gunoi cu telecomanda, 20 cm, Verde Alb','<p>Camionul de gunoi este <strong>CONTROLAT DE LA DISTANTA</strong> cu o <strong>telecomanda</strong> simplu de utilizat si are 3 caracteristici uimitoare:</p> <div> <p>1. are <strong>o gama completa de miscare</strong> - se misca in toate directiile</p> <p>2. <strong>efecte de iluminare</strong> - luminile din fata functioneaza atunci cand merge in fata</p> <p>3. <strong>alinierea rotilor</strong> - dupa un joc interesant, le puteti seta din nou corect</p> </div> <div> <p><strong>Culorile</strong> clasice, alb si verde sunt <strong>blande</strong> si se refera la ecologie. Camionul de gunoi pe lateralele vehiculului are simboluri legate de separarea deseurilor. Datorita acestui lucru, este usor de recunoscut pe drumurile orasului, iar un copil va intelege functiile unui camion de gunoi de la o varsta frageda.</p> <p><strong>Un copil care foloseste jucarii cu telecomanda va dezvolta coordonarea mana-ochi, stimuleaza imaginatia si antreneaza dexteritatea si gandirea logica!</strong></p> <p>Controlul vehiculului cu telecomanda va permite sa conduceti inainte, inapoi, dreapta si stanga. <strong>Calatoria in toate directiile</strong> face distractia mai atractiva.</p> <p><strong>Farurile stralucitoare</strong> il fac pe copil mai dispus sa ajunga la jucarie si, de asemenea, sa inteleaga ca pe drumuri ar trebui sa aveti luminile aprinse toata ziua.</p> </div> <div> <p><strong>Partile mobile ale vehiculului</strong> fac distractia reala. Dupa incarcarea deseurilor, camionul de gunoi le poate arunca intr-un loc desemnat - la groapa de gunoi.</p> <p><strong>Camionul de gunoi ii invata pe copii sa aiba grija de mediu si le permite sa inteleaga functionarea vehiculelor din oras.</strong></p> <p>Setul este alimentat de baterii AA, care trebuie achizitionate - nu sunt incluse. Puterea bateriei inseamna ca putem controla independent masina si aprinde luminile din ea.</p> <p><strong>Aspect realist:</strong></p> <p>Masina este realizata cu atentie la detalii, ceea ce o face sa arate extrem de realist. Masina la suprafata arata uimitor!</p> <p>O masina cu telecomanda va fi un cadou grozav pentru copiii cu varsta peste 3 ani. Va functiona atat pentru baieti, cat si pentru fete.</p> </div>',83.99,19.00,99.95,8,'Active','2024-08-11 07:58:43','2024-08-11 13:40:19'),(146,1,'SB-276','6045500206617','OEM','Binoclu de jucarie, 13 cm, Camuflaj','<div> <p><strong>Primul tau binoclu</strong> ce te ajuta sa explorezi de la distanta lucruri intangibile. Campul vizual mare si factorul de marire garanteaza micului cercetator noi descoperiri.</p> <p><strong>Pachetul include:</strong></p> <ul><li>un binoclu cu lentile din plastic rezistent</li> <li>snur atasat pentru atarnarea binoclului de gat in conditii de siguranta</li> </ul><p><strong>Dimensiune:</strong> 12 cm</p> <p><strong>Varsta recomandata:</strong> 3 - 7 ani</p> <p><strong>Atentie!</strong> Contraindicat copiilor mai mici de 3 ani. Nu lasati ambalajele jucariilor/produselor la indemana copiilor. Indepartati orice ambalaj al jucariei/produsului inainte de a da jucaria/produsul copilului. Va rugam sa supravegheati copilul in timp ce se joaca/foloseste acest produs. Pastrati instructiunile si etichetele pentru referinte viitoare. Pastrati jucaria/produsul departe de foc; feriti jucaria/produsul de temperaturi ridicate si umiditate.</p> </div>',17.63,19.00,20.98,8,'Active','2024-08-11 07:58:45','2024-08-11 14:34:09'),(147,1,'SB-260','0749672945843','OEM','Masina cu telecomanda pentru copii 2.4 GHz, Controlabila cu ceas de mana, Rotire 360 grade, Lumini interactive, Reincarcabila, Pentru cascadorii, Rosu','<p>Masinuta cu telecomanda pentru copii ce se poate controla prin ceas si telecomanda. Acesta este instrumentul perfect pentru a-si dezvolta abilitatile de coordonare si pentru a se distra la maxim.</p> <p>ATENTIE! Daca doriti sa folositi telecomanda masinii dupa ce s-a folosit cu ceasul, masinuta trebuie oprita si pornita din nou pentru a se face schimbarea!</p> <p> </p> <p>Cu functia de intoarcere acrobatica, masinuta noastra poate realiza cascadorii spectaculoase si miscari surprinzatoare. O experienta plina de adrenalina pentru micii soferi.</p> <p>Aceasta masina RC deformabila se poate misca in toate directiile, face intoarceri de 360 de grade, tractiune pe 4 roti, cu o distanta de control de 40 de metri, va permite sa o jucati in aer liber fara griji.</p> <p>Masinuta functioneaza pe baza unui acumulator reincarcabil, acesta vine insotit de cablul de incarcare, iar telecomanda functioneaza pe baza a 2 baterii AA(nu sunt incluse in pachet). Totodata ceasul vine insotit cu 2 baterii 1.5V AAA.</p> <p> </p>',158.81,19.00,188.98,4,'Active','2024-08-11 07:58:46','2024-08-11 14:50:33'),(148,1,'SB-278','0749672946079','OEM','Set papusi Elsa, Ana si Olaf, 40cm','<p>Papusi Elsa, Ana si Olaf</p> <p>Daca iti plac personajele din filmul Disney Frozen, atunci vei adora aceste papusi Elsa, Anna si Olaf. Papusile sunt imbracate in rochii elegante inspirate de tinutele lor din film. Olaf are un aspect perlat special. Papusile au parul lor specific blond si roscat. Poti recrea scene din film sau inventa propriile tale aventuri cu aceste papusi Elsa, Anna si Olaf.</p> <p>Papusile au 40 cm inaltime si sunt potrivite pentru copii de peste 3 ani. Setul include 3 papusi: Elsa, Anna si Olaf</p>',84.03,19.00,100.00,3,'Active','2024-08-11 07:58:49','2024-08-11 14:54:15'),(149,1,'SB-266','0749672945959','OEM','Suport aluminiu telefon-tableta, 90x70x20mm','<table><tbody><tr><td> <p><strong>COMPATIBILITATE UNIVERSALA</strong></p> <p>Suportul universal pentru telefonul mobil este compatibil cu toate telefoanele inteligente si tabletele de 4-12,9 inch, precum iPhone 12/11 Pro Max Mini / SE / Xs / XR / X, Samsung Galaxy Note 10 Plus / S20 / S10e / S9 Plus / S8, LG, iPad, Samsung Tab, Google Nexus etc.</p> </td> </tr><tr><td> </td> </tr><tr><td> <p><strong>UNGHI REGLABIL </strong></p> <p>Suportul telefonului mobil poate fi ajustat cu usurinta pana la 270 de grade pentru a oferi cel mai confortabil unghi de vizionare in timp ce vizionati videoclipuri sau filme, jucati jocuri, efectuati apeluri telefonice.</p> </td> </tr><tr><td> </td> </tr><tr><td> <p><strong>CONSTRUCTIE </strong></p> <p>Suportul pentru telefon desktop este fabricat din aliaj de aluminiu premium, ceea ce ii asigura sa ramana ferm pe loc si sa tina telefonul mobil sau tableta in mod constant.</p> </td> </tr><tr><td> </td> </tr><tr><td> <p><strong>PLIABIL SI PORTABIL</strong></p> <p>Complet pliabil si compact, acest suport pentru telefonul mobil poate fi usor ambalat intr-un rucsac, geanta de mana sau valiza pentru calatorii.</p> </td> </tr><tr><td> </td> </tr><tr><td> <p><strong>ANTI-SCRATCH &amp; ANTI-SLIP</strong></p> <p>Tampoanele moi din silicon va protejeaza dispozitivul de orice zgarieturi, in timp ce tamponul antiderapant din partea de jos il impiedica sa alunece.</p> </td> </tr></tbody></table>',42.01,19.00,49.99,0,'Active','2024-08-11 07:58:51','2024-08-11 07:58:51'),(150,1,'SB-271','0749672945980','OEM','Set de broderie, pictura cu diamante 5d, Model Leu, 30x40cm, Multicolor','<div> <p><strong>Kit Broderie cu Diamante Rotunde - Model Leu, Dimensiune Tablou 30x40cm, Mozaic, Multicolor</strong></p> <p>Broderia de diamant consta in aranjarea unui mozaic cu mii de diamante mici, diamante colorate, in conformitate cu panza imprimata. Imaginea este acoperita cu un strat adeziv care tine cristalele la locul lor.</p> <p>Acest kit de broderie cu diamante rotunde din rasina, va ofera oportunitatea de a crea broderii spectaculoase, cu o textura foarte placuta la atingere. De asemenea, calitatea diamantelor este una foarte inalta, care asigura aceeasi culoare vibranta chiar si dupa trecerea unei perioade foarte indelungate de timp, iar panza este impermeabila si prezinta o textura foarte fina.</p> <p><strong>Mod de utilizare:</strong></p> <p>Fiecare diamant corespunde unui cod. Acestea sunt asezate dupa culoare, in ordinea codarii. Conform codului de culoare, lipiti diamantul in orificiul corespunzator, cu ajutorul stiloului special.</p> <p><img alt=\"\" src=\"https://www.bootic.ro/wp-content/uploads/2022/08/Set-de-broderie-cu-diamante-5d-cai_7-300x300.jpg\"></p> <p><strong>Specificatii:</strong></p> <ul><li>Model: Leu</li> <li>Dimensiuni: 30x40 cm</li> </ul><p><strong>Pachetul include:</strong></p> <ul><li>1 x Panza</li> <li>Diamante de diferite culori</li> <li>1 x Stilou special pentru diamante</li> <li>Adeziv</li> <li>1 x Tava pentru depozitarea temporara a diamantelor</li> </ul></div>',24.37,19.00,29.00,0,'Active','2024-08-11 07:58:52','2024-08-11 07:58:52'),(151,1,'SB-261','0749672945850','OEM','Masina sport cu telecomanda si Semafor, Lumini si Sunete, baterii incluse, 25 cm, Alb','<p>Masina sport cu telecomanda si Semafor</p> <p>Aceasta minunata masina cu Semafor va starni atentia si curiozitatea tuturor pasionatilor de masini.</p> <p> </p> <p>Semaforul functioneaza pe baterii(sunt incluse in pachet). Prin simpla apasare a butonului de deasupra, acesta va incepe sa lumineze si mai apoi sa piuie la schimbarea culorilor.</p> <p> </p> <p>Acest produs nu este destinat copiilor cu varsta sub 3 ani.</p>',142.00,19.00,168.98,2,'Active','2024-08-11 07:58:53','2024-08-11 13:41:29'),(152,1,'SB-287','0749672946161','Baby Toys','Saltea de joaca muzicala Interactiva cu pian,74x56 cm, print Dinozauri, pentru Bebelusi, Roz','<p><strong>Saltea Gimnastica si Joaca, Fitness Bebe</strong></p> <p>Salteluta cu Pian, Gimnastica si Joaca este cea mai buna alegere pentru cultivarea talentului muzical al bebelusului. Cand va lovi cu piciorusele cheia pianului si va atinge cu manutele jucariile atarnatoare care fac zgomotele curioase pentru urechiusele lui, aceasta salteluta va deveni &ldquo;sala de forta&rdquo; a Bebelusului dvs ajutandu-l extrem de mult la dezvoltarea musculara a membrelor.<span><span></span></span></p> <p>Multitudinea de jucarii care atarna vor atrage atentia bebelusului si il determina sa faca eforturile de a le atinge. Acestea au un mare efect in dezvoltarea senzoriala tactila, auditiva si vizuala a bebelusului.</p> <p>Muzica de pian va insoti copilul in lumea viselor.</p> <p>Toate accesoriile Saltelutei sunt netoxice si inofensive pentru copil.</p> <p> </p> <p>Perna detasabila si lavabila ofera bebelusului un mediu curat iar culorile acesteia nu se vor estompa in timp.</p> <p>Salteluta ofera copilului dumneavoastra patru moduri diferite de a se juca. In timp ce este asezat pe spate si se joaca, copilul tau poate privi deasupra la arcul de care atarna jucarii stralucitoare si amuzante. De asemenea, el / ea va invata sa depuna efortul de a ajunge la ele si sa le apuce. Este indeajuns sa mutati arcul &#8203;&#8203;cu jucarii in jos pentru a se juca pe burtica sau sa cante la pian.</p>',110.00,19.00,130.90,11,'Active','2024-08-11 07:58:57','2024-08-11 14:39:21'),(153,1,'SB-279','0749672946154','OEM','Masina metalica Politie, Lumini si Sunete, Usi mobile,11 cm, Verde','<p><strong>Varsta</strong>: 3+ (nu este potrivit pentru copiii sub 3 ani)</p> <div> </div> <div><strong>Material</strong>: Corp metalic cu piese din plastic</div> <div> </div> <div><strong>Caracteristici</strong>: Lumina si sunet (butonul se afla sub roata fata-dreapta si se actioneaza prin apasarea rotii), usi care se pot deschide, actionare pull-back</div> <div><br><strong>Ideal pentru</strong>: iubitori de masini, pasionati de masini, miniaturi<br> colectionari de modele, jucarie perfecta pentru copiii care<br> iubesc sa se joace cu masini in miniatura, obiecte de colectie</div> <div><br><strong>Dimensiuni produs</strong> (aproximativ): Jucaria metalica<br> masina masoara 11 cm lungime, 5 cm latime</div>',47.05,19.00,55.99,24,'Active','2024-08-11 07:59:00','2024-08-11 13:53:55'),(154,1,'SB-277','0749672946062','Istoys','Stivuitor cu efecte sonore si luminoase','<p>Un stivuitor grozav: alegerea perfecta pentru orice mic fan de automobile si constructii.</p> <p>Acest vehicul va fi un supliment frumos pentru o colectie mai mare de masini de constructii, dar va functiona bine si ca o jucarie independenta.</p> <p>Vehiculul este realizat cu atentie la detalii, la scara 1:16, ceea ce il face foarte realist si va functiona atat ca jucarie, cat si ca model.</p> <p> </p> <p><img alt=\"Stivuitor cu sunet 1:16 PALET\" src=\"https://a.allegroimg.com/original/117218/40ba51c84d52a055a3572e297fd2/WOZEK-WIDLOWY-SWIATLO-I-DZWIEK-1-16-PALETA\"></p> <p> </p> <p>Aceasta masina are o unitate de frecare: dupa ce rotile care se afla pe sol sunt puse in miscare, se misca. Datorita rotilor largi de cauciuc, deplasarea este o placere pura si fara zgarieturi pe podea. Stivuitorul are 2 butoane care scot 2 sunete diferite, cu fiecare efect sonor luminile vehiculului clipesc:</p> <ul><li>Zgomotul pornirii motorului</li> <li>Claxon</li> <li>Sunet de mers inapoi al vehiculului</li> </ul><p> </p> <p>Furcile caruciorului pot fi ridicate manual cu o manivela, ceea ce va permite sa mutati paletul inclus ca un adevarat profesionist.</p> <p>Datorita ambalajului sau solid, va fi cadoul perfect pentru un copil.</p>',75.62,19.00,89.99,8,'Active','2024-08-11 07:59:01','2024-08-11 18:10:38'),(155,1,'SB-267','0749672945942','OEM','Geanta organizator cosmetice pentru calatorie cu 4 compartimente, 24 x 15 cm, Negru/Roz','<p>Geanta &ldquo;Roll&rsquo;n&rsquo;go&rdquo; cosmetica este solutia perfecta pentru a-ti <strong>pastra</strong> produsele cosmetice in <strong>ordine</strong>. Organizatorul de calatorie va va pastra in siguranta <strong>toate produsele cosmetice</strong>, cum ar fi pudra, creioanele, rujurile si alte accesorii.</p> <p><br> Datorita dimensiunilor sale reduse atunci cand este rulat, este ideal pentru geanta de mana sau geanta de voiaj a unei femei.</p> <p><br> Organizatorul are 4 buzunare incapatoare cu fermoar.<br> In plus, organizatorul de toaleta are un maner pentru ca aceasta, atunci cand este desfacuta sa poata fi atarnata pe un carlig din baie sau pe o usa.<br> SPECIFICATII TEHNICE:<br> &middot; Are 4 buzunare spatioase cu fermoar<br> &middot; Elegant si confortabil<br> &middot; Ideal pentru produse cosmetice, bijuterii sau alte accesorii<br> &middot; Ideal pentru calatorii<br> &middot; Se inchide cu inchizatoare magnetizate<br> &middot; Space saver<br> &middot; Dimensiuni la pliat: 24,5 cm x 15 cm<br> &middot; Dimensiuni la desfacere: 44 cm x 24,5 cm<br> &middot; Culoare: negru cu roz<br> SETUL INCLUDE:<br> &middot; Geanta cosmetica noua din fabrica<br> &middot; Ambalaj original</p>',21.00,19.00,24.99,0,'Active','2024-08-11 07:59:07','2024-08-11 07:59:07'),(156,1,'SB-272','0749672945997','OEM','Mousepad Mare Cauciucat, Pentru Gaming, Birou, Antiderapant, Cusaturi Anti-Rupere, model Galaxie, 90 x 40cm, Multicolor','<div> <p><strong>Un mousepad pentru gaming</strong> este o completare perfecta pentru orice birou. Nu conteaza daca joci ocazional sau stai in mod regulat pana tarziu, mousepad-ul nostru va face fiecare moment petrecut in fata ecranului mai placut.</p> <p><img alt=\"\" src=\"https://marketplace-static.emag.ro/resources/000/045/073/725/45073725.png\"></p> <p>Mousepad-ul este <strong>realizat dintr-un material flexibil</strong> cu o textura delicata care imbunatateste performanta si precizia. <strong>Invelisul de cauciuc</strong> de pe partea inferioara a placutei<strong> il impiedica sa se miste</strong> in jurul biroului. Tamponul este, de asemenea, <strong>rezistent la umiditate.</strong></p> <p><img alt=\"\" src=\"https://marketplace-static.emag.ro/resources/000/045/073/797/45073797.png\"></p> <h2><strong>SPECIFICATII TEHNICE:</strong></h2> <p>&#9989; Manopera <strong>de inalta calitate</strong></p> <p>&#9989; <strong>Anti-alunecare</strong></p> <p>&#9989; Suprafata respirabila</p> <p>&#9989; <strong>Tivul pe margini</strong></p> <p>&#9989; <strong>Rezistent la scurgeri</strong></p> <p>&#9989; Grafica interesanta:<strong> Galaxie</strong></p> <p><img alt=\"\" src=\"https://marketplace-static.emag.ro/resources/000/045/073/820/45073820.png\"></p> <h2><strong>DIMENSIUNI:</strong></h2> <p>&#9989; Lungime: <strong>90 cm</strong></p> <p>&#9989; Latime: <strong>40 cm</strong></p> <div> <img border=\"0\" src=\"https://upload.cdn.baselinker.com/products/3012437/f1fc5aa55281a83471aa6b531056e104.jpg\" alt=\"Unknown Image\"></div> <div> <h2> </h2> </div> </div>',42.00,19.00,49.98,18,'Active','2024-08-11 07:59:07','2024-08-11 15:20:53'),(157,1,'CB-10','0749672946031','Verk Group','Cutie de bijuterii organizatoare cu oglinda 23cm','<p>Vine cu o culoare superba verde smarald, foarte usor de folosit si extrem de practica.</p> <p>Cutia de bijuterii este un accesoriu util si indispensabil pentru a pastra in siguranta bijuteriile preferate.</p> <p>Obtineti un accesoriu de pret si practic, datorita acestei cutii pentru bijuterii, care va face ordine intre cercei si pandantive, iar in acelasi timp le va proteja impotriva prafului si a zgarieturilor.</p>',50.00,19.00,59.50,0,'Active','2024-08-11 07:59:09','2024-08-11 07:59:09'),(158,1,'SB-268','0749672945966','OEM','Set de broderie/pictura cu diamante, mozaic, model Copac, 30x30cm','<div> <p><strong>Kit Broderie cu Diamante Rotunde - Model Copacul Vietii, Dimensiune Tablou 30x30cm, Mozaic, Multicolor</strong></p> <p>Broderia de diamant consta in aranjarea unui mozaic cu mii de diamante mici, diamante colorate, in conformitate cu panza imprimata. Imaginea este acoperita cu un strat adeziv care tine cristalele la locul lor.</p> <p>Acest kit de broderie cu diamante rotunde din rasina, va ofera oportunitatea de a crea broderii spectaculoase, cu o textura foarte placuta la atingere. De asemenea, calitatea diamantelor este una foarte inalta, care asigura aceeasi culoare vibranta chiar si dupa trecerea unei perioade foarte indelungate de timp, iar panza este impermeabila si prezinta o textura foarte fina.</p> <p><strong>Mod de utilizare:</strong></p> <p>Fiecare diamant corespunde unui cod. Acestea sunt asezate dupa culoare, in ordinea codarii. Conform codului de culoare, lipiti diamantul in orificiul corespunzator, cu ajutorul stiloului special.</p> <p><img alt=\"\" src=\"https://www.bootic.ro/wp-content/uploads/2022/08/Set-de-broderie-cu-diamante-5d-cai_7-300x300.jpg\"></p> <p><strong>Specificatii:</strong></p> <ul><li>Model: Copacul Vietii</li> <li>Dimensiuni: 30x30 cm</li> </ul><p><strong>Pachetul include:</strong></p> <ul><li>1 x Panza</li> <li>Diamante de diferite culori</li> <li>1 x Stilou special pentru diamante</li> <li>Adeziv</li> <li>1 x Tava pentru depozitarea temporara a diamantelor</li> </ul></div>',21.00,19.00,24.99,0,'Active','2024-08-11 07:59:10','2024-08-11 07:59:10'),(159,1,'237','0749672946048','Invincio','Organizator bijuterii INVINCIO Jewel pliabil, 153 de suporti pentru cercei, 21 pentru coliere sau bratari, oglinda make-up, carcasa material premium cu detalii aurii, culoare verde jad','<p>Acest organizator de bijuterii pliabil si rezistent la praf este solutia perfecta pentru a va pastra bijuteriile in conditii optime.</p> <p>Cu un design ingenios care permite plierea usoara, acesta protejeaza bijuteriile dumneavoastra de oxidare si praf.</p> <p>Cu o capacitate generoasa, acest organizator are spatiu pentru 153 de cercei, 21 de coliere si multe altele.</p> <p>Materialul de inalta calitate il face durabil si rezistent la decolorare, iar aspectul elegant il transforma intr-un cadou minunat pentru orice ocazie.</p> <p>Pastrati-va bijuteriile in siguranta si stralucire cu acest organizator practic si frumos.</p> <p> </p> <p><strong>Pliabil si rezistent la praf </strong></p> <p>Designul permite sa fie deschis si pliat cu usurinta, ceea ce poate reduce contactul bijuteriilor cu aerul, incetinind astfel rata lor de oxidare si ajutandu-va sa protejati bijuteriile mai bine.</p> <p>Designul pliabil ocupa mai putin spatiu, iar cutia de bijuterii complet acoperita tine bijuteriile departe de praf si le mentine stralucitoare tot timpul.</p> <p> </p> <p><strong>Capacitate mare si economisire de spatiu</strong></p> <p>Acest suport pentru bijuterii cu oglinda are:</p> <ul><li>153 de orificii pentru cercei,</li> <li>21 de crestaturi pentru coliere</li> <li>3 crestaturi in forma de U, poate pastra toate colierele, inelele si cerceii</li> </ul><p>Luati-l cu dumneavoastra cand calatoriti, modalitatea pliabila este convenabila pentru calatorie si transport.</p> <p>Se potriveste pe orice comoda, noptiera sau coafa, compact si convenabil de utilizat.</p> <p> </p> <p><strong>Material de inalta calitate</strong></p> <p>Fabricat din material de inalta calitate, organizatorul de bijuterii este durabil, solid, rezistent la praf si rezistent la decolorare.</p> <p>Constructia solida si materialul de calitate il fac foarte rezistent.</p> <p>Designul pliabil economiseste spatiu pe masa dumneavoastra de machiaj, lasand mai mult loc pentru accesorii.</p> <p> </p> <p><strong>Stocare multifunctionala</strong></p> <p>Evitati ca praful sa intre in organizatorul de cercei si coliere, astfel ca nu trebuie sa va faceti griji cu privire la incurcarea si oxidarea bijuteriilor.</p> <p>Acest lucru il face cea mai buna alegere pentru stocarea colierelor, inelelor, pandantivelor, cerceilor, diamantelor, cristalelor, chihlimbarului, agatului si giuvaerurilor.</p> <p> </p> <p><strong>Alegerea cadoului perfect</strong></p> <p>Aceasta cutie de bijuterii este proiectata cu un design elegant.</p> <p>Va fi cea mai buna idee de cadou pentru prietenele, sotiile, surorile, mamele si bunicile de orice varsta.</p> <p> </p> <p>Cu acest organizator de bijuterii pliabil si rezistent la praf, veti avea intotdeauna bijuteriile la indemana si in stare impecabila.</p> <p>Fie ca il utilizati acasa sau in calatorii, acest produs va ajuta sa va mentineti colectia de bijuterii organizata si protejata.</p> <p>Cu un aspect elegant si o functionalitate excelenta, acest organizator este alegerea perfecta pentru a va bucura de bijuteriile dumneavoastra in fiecare zi. Investiti in calitate si frumusete, alegeti acest organizator pentru a va pastra bijuteriile in siguranta si in stralucirea lor naturala.</p> <p> </p> <p>Detalii produs</p> <p>153 de gauri pentru cercei mici</p> <p>21 de suporti pentru coliere</p> <p>3 sloturi in forma de \"U\"</p> <p> </p> <p>Caracteristici:</p> <ul><li>Suportul pentru stocarea bijuteriilor este fabricat din plastic de inalta calitate, cu 4 panouri transparente si 153 de gauri pentru cercei si coliere.</li> <li>Designul pliabil economiseste spatiu si este convenabil pentru depozitare.</li> <li>Suportul pentru coliere din acril este fabricat din material acrilic durabil si transparent, robust si rezistent in timp.</li> <li>Potrivit pentru uz casnic, magazine de bijuterii, etc.</li> <li>Potrivit pentru orice comoda, noptiera sau coafa, mentineti toate colierele, inelele si cerceii organizati, bucurandu-va sa le vedeti. Economisiti spatiu de stocare in sertare sau comode, compact si usor de utilizat.</li> </ul><p>Pachetul Include:</p> <p>1 x suport pentru bijuterii (nu includ alte accesorii)</p>',68.00,19.00,80.92,24,'Active','2024-08-11 07:59:12','2024-08-11 14:33:31'),(160,1,'SB-292','0749672946215','OEM','Set 8 in 1, Sah, Table, Dame, Dame chinezesti, Nine Men\'s Morris Game, Snakes & Ladders Game, Ludo Game, Goose Game, Multicolor','',63.03,19.00,75.01,5,'Active','2024-08-11 07:59:13','2024-08-11 13:47:53'),(161,1,'SB-286','0749672946147','BOOIZHIGUANG','Set 5 masini de construit si 5 masini de gunoi, 9 cm, Multicolor','<p>Set 5 utilaje de construit si Set 5 utilaje sanitare</p> <p>Dimensiunea unei masinute este de 8 cm x 4 cm x 3 cm</p>',42.01,19.00,49.99,8,'Active','2024-08-11 07:59:18','2024-08-11 14:44:00'),(162,1,'236','0749672946055','Invincio','Organizator bijuterii INVINCIO Jewel pliabil, 153 de suporti pentru cercei, 21 pentru coliere sau bratari, oglinda make-up, carcasa material premium cu detalii aurii, culoare alba','<p><span><span><span><span>Acest organizator de bijuterii pliabil si rezistent la praf este solutia perfecta pentru a va pastra bijuteriile in conditii optime. </span></span></span></span></p> <p><span><span><span><span>Cu un design ingenios care permite plierea usoara, acesta protejeaza bijuteriile dumneavoastra de oxidare si praf. </span></span></span></span></p> <p><span><span><span><span>Cu o capacitate generoasa, acest organizator are spatiu pentru 153 de cercei, 21 de coliere si multe altele. </span></span></span></span></p> <p><span><span><span><span>Materialul de inalta