igilabile rezista pana la -50&deg;C, fiind ideale pentru a pastra mancarea rece pentru o perioada mai lunga.</p> <p>Setul contine 30 de pungi de 1L si 30 de pungi de 0.4L.</p> <p>Pungile sunt realizate dintr-un material de calitate superioara, ce le face robuste si pot fi folosite de nenumarate ori. Aceste pungi sunt prevazute cu un sistem de inchidere ermetic, astfel incat sa poti fi sigur ca continutul ramane proaspat si nu se va varsa. Fie ca doresti sa pastrezi alimente pentru pranzul la serviciu, sau sa pastrezi produsele alimentare la frigider sau la congelator, aceste pungi sunt solutia ideala.</p> <p>Pungile resigilabile de 1L si 0.4L sunt perfecte pentru a pastra bucataria si casa ta organizate si curate. Poti sa le utilizezi pentru a pastra diferite obiecte, cum ar fi jucariile pentru copii, medicamentele sau alte obiecte personale. Aceste pungi sunt disponibile intr-o gama variata de dimensiuni si sunt usor de utilizat si depozitat.</p> <p> </p>',21.00,19.00,24.99,0,'Active','2024-08-11 07:59:47','2024-08-11 07:59:47'),(182,1,'MG603','8435507857161','Euroswan','Sac sport Frozen Believe in Magic 40x30 cm Albastru','Bretele reglabile pentru un transport usor si inchidere facila cu snur<br> Sacul este potrivit pentru hainutele necesare la gradinita, la scoala sau pentru antrenament<br> Material: poliester',21.00,19.00,24.99,0,'Active','2024-08-11 07:59:47','2024-08-11 07:59:47'),(183,1,'SB-504','0749672946291','Almido','Set Figurine Animale salbatice savana Almido, 6 piese, 14 cm, multicolor','<div> <p>Figurinele sunt confectionate din material flexibil rezistent . Dimensiunea unei figurine este de 10 cm lungime, 6 cm inaltime, 3 cm latime.</p> <p> </p> <p><br> Ofera- i si tu copilului tau posibilitatea de a- si crea lumi magice.</p> <ul><li> <h4>Copiii isi dezvolta imaginatia.</h4> </li> </ul><p>In jocurile de roluri cu figurine, copiii sunt personaje principale, actori, scenaristi, regizori. Universul creat este in totalitate opera lor. Povestile nascocite, jocurile de roluri, contribuie la imbogatirea imaginatiei si creativitatii. Copiii nu cunosc tipare in gandire astfel incat imaginatia lor nu are granite.</p> <ul><li> <h4>Copiii descopera lumea.</h4> </li> </ul><p>Copiii imita adultii iar prin intermediul figurinelor ii putem invata multe lucruri despre lumea inconjuratoare.</p> <ul><li> <h4>Copiii invata tehnicile comunicarii.</h4> </li> </ul><p>Prin intermediul figurinelor copiii simuleaza situatii si intamplari care ii provoaca sa se exteriorizeze. Ei devin mai receptivi si cooperanti atat cu alti copii cat si cu adultii.</p> </div>',50.00,19.00,59.50,0,'Active','2024-08-11 07:59:49','2024-08-11 07:59:49'),(184,1,'RSC2','0749672946277','IKEA','Set 5 role scame adezive, 57 m, 300 file','<p>Setul de 5 role adezive este ideal pentru indepartarea scamelor nedorite de pe haine, lenjerii de pat, perne, tapiterii sau alte materiale textile.<br> Datorita adezivului puternic, rola aduna cu usurinta si succes parul si blana de animale, praful, scamele si alte particule mici.<br> Este un produs practic si foarte usor de folosit in orice situatie si oriunde ai nevoie<br><strong>Caracteristici:</strong></p> <ul><li>Indepartare usoara si rapida a parului de animale</li> <li>Ideala pentru utilizarea pe textile, tapiterie si alte materiale</li> <li>Maner ergonomic pentru un plus de confort</li> <li>Orificiu de prindere pentru a-l depozita intr-un loc special si a-l avea mereu la indemana</li> <li>Foarte utila oriunde si in orice moment, fie ca esti acasa, la birou sau intr-o calatorie</li> <li>Setul este compus dintr-o rola pentru scame si 2 rezerve</li> <li>160 de file adezive usor de indepartat dupa fiecare utilizare datorita structurii pre-taiate</li> <li>Diametru rola: 4.5 cm</li> <li>Lungime rola: 10 cm</li> <li>Lungime maner: 22 cm</li> </ul>',24.40,19.00,29.04,0,'Active','2024-08-11 07:59:52','2024-08-11 07:59:52'),(185,1,'SB-300','4020972019554','Almido','Papusa Wednesday cu accesorii si articulatii flexibile, 30 cm',